import React from "react";
import FileUploader from "./components/FileUploader";
import "./App.css";

function App() {
	return (
		<div className="container">
			<div className="file-uploader">
				<h2>Desordenar Preguntas y Respuestas</h2>
				<FileUploader />
			</div>
		</div>
	);
}

export default App;
